Plot:
----------
Set in the Williamsburg neighborhood of the New York City borough of Brooklyn, the series chronicles the lives of two waitresses in their mid twentiesÃ¢â‚¬â€Max (Kat Dennings), who comes from a poor working-class family, and Caroline (Beth Behrs), who was born rich but is now disgraced and penniless due to her father, Martin Channing, getting caught operating a Bernard Madoff-esque Ponzi schemeÃ¢â‚¬â€working together at a Brooklyn restaurant. The two become friends and build toward their dream of one day opening a cupcake shop. Among those working with them at the restaurant are their boss, Han Lee (Matthew Moy); Oleg (Jonathan Kite), an upbeat but perverted Ukrainian cook; and Earl (Garrett Morris), a 75-year-old African-American cashier. Also featured starting late in the first season is their neighbor and part-time boss Sophie (Jennifer Coolidge), a Polish immigrant who runs the housecleaning company Sophie's Choice. During most of the first season Max is also a part-time nanny for the twin babies of Peach Landis (Brooke Lyons), who during the season adopts Caroline's horse Chestnut. At the end of each episode a tally shows how much they have made toward their goal of $250,000 needed to open their business. Early in the second season, Sophie lends the girls $20,000, which is enough for them to start their business. However, the business fails, and in the 18th episode they are forced to give up the lease of their cupcake shop with just enough money to pay off Sophie's loan, resetting the end of episode tally to $5.00.


